import React from 'react';
import {css, StyleSheet} from 'aphrodite';
import Header from "../../helpers/Headers";
import HelloAndImage from "./HelloAndImage";
import Cartegories from "./Categories";
import back from "../../../image/back.png"
import "../../css/layout.css"

const Main = () => {

    const style = StyleSheet.create({
        root:{
            backgroundImage: `url(${back})`,
            backgroundSize: "45%",
            backgroundRepeat: "no-repeat",
        },
        spaceHeight: {
            "margin-bottom": "2.5%",
        }
    })

    return (
        <div className={css(style.root)}>
            <div className="body">
                <Header main={true}></Header>
                <div className={css(style.spaceHeight)}></div>
                <HelloAndImage></HelloAndImage>
                <div className={css(style.spaceHeight)}></div>
                <Cartegories></Cartegories>
            </div>
        </div>
    );
};

export default Main;
